#include <unordered_map>

bool isConstructible(const std::string& s) {
    // Initialize an unordered map to store the counts of each character in the string
    std::unordered_map<char, int> charCount;

    // Initialize a variable to store the count of the first character
    int count = 0;

    // Iterate over the string to count the characters
    for (char c : s) {
        if (charCount.find(c)!= charCount.end()) {
            // If the character is already in the map, increment its count
            charCount[c]++;
        } else {
            // If the character is not in the map, add it with a count of 1
            charCount[c] = 1;
        }

        // If the count of the current character is greater than 0
        if (charCount[c] > 1) {
            // Return false because we can't construct the string by appending multiple copies of the substring
            return false;
        }

        // Update the count of the first character
        count += charCount[c];
    }

    // If the string can be constructed by appending multiple copies of the substring
    return count == s.length();
}

