class Node:
    """Represents a node in the binary tree."""

    def __init__(self, data):
        """Initializes a new node with the given data."""
        self.data = data
        self.left = None
        self.right = None


class BinaryTree:
    """Represents a binary tree."""

    def __init__(self):
        """Initializes an empty binary tree."""
        self.root = None


    def insert(self, data):
        """Inserts a new node with the given data into the binary tree."""

        if not self.root:
            self.root = Node(data)
        else:
            self._insert(data, self.root)


    def _insert(self, data, node):
        """Recursively inserts a new node into the binary tree."""

        if data < node.data:
            if node.left:
                self._insert(data, node.left)
            else:
                node.left = Node(data)
        else:
            if node.right:
                self._insert(data, node.right)
            else:
                node.right = Node(data)


    def inorder(self):
        """Prints the binary tree using inorder traversal."""

        self._inorder(self.root)


    def _inorder(self, node):
        """Recursively prints the binary tree using inorder traversal."""

        if node:
            self._inorder(node.left)
            print(node.data, end=" ")
            self._inorder(node.right)


    def preorder(self):
        """Prints the binary tree using preorder traversal."""

        self._preorder(self.root)


    def _preorder(self, node):
        """Recursively prints the binary tree using preorder traversal."""

        if node:
            print(node.data, end=" ")
            self._preorder(node.left)
            self._preorder(node.right)


    def postorder(self):
        """Prints the binary tree using postorder traversal."""

        self._postorder(self.root)


    def _postorder(self, node):
        """Recursively prints the binary tree using postorder traversal."""

        if node:
            self._postorder(node.left)
            self._postorder(node.right)
            print(node.data, end=" ")


    def print_tree(self):
        """Prints the binary tree in a human-readable format."""

        self._print_tree(self.root)


    def _print_tree(self, node):
        """Recursively prints the binary tree in a human-readable format."""

        if node:
            print(node.data, end=" ")
            self._print_tree(node.left)
            self._print_tree(node.right)


