  "totalOrderCost": 100,
  "products": [
    {
      "item": "Item A",
      "price": 10
    },
    {
      "item": "Item B",
      "price": 30
    },
    {
      "item": "Item C",
      "price": 60
    }
  ]
}
```

This JSON object has the following properties:

- `name`: The customer's name.
- `address`: The customer's address.
- `totalOrderCost`: The total cost of the customer's order.
- `products`: An array of objects, each representing a product in the customer's order. Each object has two properties: `item` and `price`, which represent the name and price of the product, respectively.
